window.bookSummaryJSON = "<p>They say you can never go back…</p> <p>‘Course, I never wanted to return. It took me years to age out. Once I made it, I took off and never turned around.</p> <p>Trust me, there were only three reasons I managed to survive there as long as I did and they abandoned me as soon as they were able. I’d like to say I didn’t blame them, but that would be a lie.</p> <p>I had zero desire to return. Yet here I was, on the road to Northland chasing a story cause my editor told me kids were disappearing… again.</p> <p>It doesn’t matter what I want, I’m taking the fastest route to the darkest part of my past.</p> <p>And then I’ll be home…</p> <p>*Please note this is a reverse harem and the authors suggest you always read the foreword in their books. Contains some dark elements, mature situations, and is definitely intended for 18+. This is a standalone and if you're very good, the elves might even bring it sooner than Christmas.</p>"; 
